local function sync_to_db(event)
    if Events[event.type] then
        Events[event.type].write_db(event)
    else
        log("Event type not supported: " .. event.type)
    end
end

local function sync_to_hc3(event)
    if Events[event.type] then
        Events[event.type].hc3_sync(event)
    else
        log("Event type not supported: " .. event.type)
    end
end

local function log_event(event)
    if Events[event.type] then
        Events[event.type].log(event)
    else
        log("Event type not supported: " .. event.type)
    end
end

local function event_from_hc3(event)
    local h = Events[event.type]
    if not h then return end
    local id,typ = h.id_and_type(event)
    if isLocal(typ,id) then
        -- optionally update local copy?
        return 
    end
    h.write_db(event)
end

local function event_from_emu(event)
    local h = Events[event.type]
    if not h then return end
    h.write_db(event)
    local id,typ = h.id_and_type(event)
    if not isLocal(typ,id) then
        h.sync_to_hc3(event)
    end
end